import './style/App.css';

function App() {
  return (
    <div className="App">
      <div class="wrapper">
        <main>
          <div class="container">
            <header class="header">
              <div class="header__inner">
                <nav class="header__navigation">

                </nav>
                <nav class="header__profile-settings"></nav>
              </div>
            </header>
            <section class="statistics"></section>
          </div>
        </main>
      <footer class="footer"></footer>
      </div>
    </div>
  );
}

export default App;
